// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";

import "./FarmBase.sol";
import "./Repository.sol";

abstract contract IFarmFactory {
    ///@dev 计算属性
    function getPlantProperties(uint256 _dna)
        public
        view
        virtual
        returns (FarmBase.PlantPropertiesPacked memory);

    ///@dev 计算DNA
    function calDna(FarmBase.PlantPropertiesPacked memory _pack)
        public
        view
        virtual
        returns (uint256 dna);

    ///@dev 计算Tag
    function calTag(
        FarmBase.PlantPropertiesPacked memory _pack,
        FarmBase.Quality quality,
        Repository.ItemType itemType
    ) public pure virtual returns (uint256 tag);

    ///@dev 生成果实
    function getFruitTag(uint256 _seedTag)
        public
        view
        virtual
        returns (uint256 fruitTag);

    ///@dev 生成种子
    function getSeedTag(FarmBase.PlantPropertiesPacked memory _pack)
        public
        pure
        virtual
        returns (uint256 seedTag);

    ///@dev 分解果实
    function disassembleFruit(uint256 _fruitTag)
        public
        virtual
        returns (uint256 seedTag, bool getSpecialSeed);

    ///@dev 根据Tag获得属性
    function getPropertiesByTag(uint256 tag)
        public
        pure
        virtual
        returns (FarmBase.PlantPropertiesPacked memory);

    ///@dev 获得梦幻种子tag
    function getDreamySeedTag() public view virtual returns (uint256);

    ///@dev 获得杂交种子tag
    function getHybridizedSeedTag(uint256 parent1, uint256 parent2)
        public
        pure
        virtual
        returns (uint256);

    ///@dev 获得收获果实tag
    function getHarvestFruitTag(uint256 parent1, uint256 parent2)
        public
        view
        virtual
        returns (uint256);

    ///@dev 杂交检查
    function HybridizationCheck(
        address _owner,
        uint8 _x,
        uint8 _y
    ) public view virtual returns (uint8, uint256);

    ///@dev 随机杂交
    function randomHybridize(
        address _owner,
        uint8 _x,
        uint8 _y
    ) public view virtual returns (uint8);
}

contract FarmFactory is IFarmFactory, FarmBase {
    constructor(Repository _repo) FarmBase(_repo) {}

    function _generateDna(uint256 Dna1, uint256 Dna2)
        private
        pure
        returns (uint256)
    {
        uint256 child;
        child = (Dna1 + Dna2) / 2;
        return child;
    }

    function getFruitTag(uint256 _seedTag)
        public
        view
        override
        returns (uint256 fruitTag)
    {
        PlantPropertiesPacked memory pack = getPropertiesByTag(_seedTag);
        Quality quality;
        if (repo.probabilityCheck(1, 100)) {
            quality = Quality(3);
        } else if (repo.probabilityCheck(5, 99)) {
            quality = Quality(2);
        } else if (repo.probabilityCheck(10, 94)) {
            quality = Quality(1);
        }
        return calTag(pack, quality, Repository.ItemType.Fruit);
    }

    function getSeedTag(PlantPropertiesPacked memory _pack)
        public
        pure
        override
        returns (uint256 SeedTag)
    {
        uint256 tag = calDna(_pack);
        tag << 5;
        return tag;
    }

    function getPlantProperties(uint256 _dna)
        public
        pure
        override
        returns (PlantPropertiesPacked memory)
    {
        uint256 dna = _dna;
        if (dna > (1 << 12)) {
            dna <<= 5;
        }
        PlantPropertiesPacked memory pack;
        pack.spd = uint8(dna % 8);
        dna >> 3;
        pack.def = uint8(dna % 8);
        dna >> 3;
        pack.atk = uint8(dna % 8);
        pack.hp >> 3;
        pack.specie = Specie(uint8(dna % 16));
        return pack;
    }

    function calDna(PlantPropertiesPacked memory _pack)
        public
        pure
        override
        returns (uint256 dna)
    {
        uint256 _dna =
            _pack.spd +
                (_pack.def << 3) +
                (_pack.atk << 6) +
                (_pack.hp << 9) +
                (uint8(_pack.specie) << 13);
        return _dna;
    }

    function calTag(
        PlantPropertiesPacked memory _pack,
        Quality quality,
        Repository.ItemType itemType
    ) public pure override returns (uint256 tag) {
        uint256 _tag =
            (calDna(_pack) << 5) + (uint256(quality) << 3) + uint256(itemType);
        return _tag;
    }

    //分解果实
    //参数：FruitTag
    //返回：SeedTag、bool(是否获得梦幻种子)
    function disassembleFruit(uint256 _fruitTag)
        public
        view
        override
        returns (uint256 seedTag, bool getSpecialSeed)
    {
        uint256 specie = _fruitTag >> 17;
        require(specie < 8, "");
        uint256 dna = _fruitTag >> 3;
        uint256 quality = dna % 4;
        dna >> 2;
        PlantPropertiesPacked memory pack = getPlantProperties(dna);
        pack = generateRandomAttribute(pack, quality);
        bool check;
        if (quality == 3) {
            check = repo.probabilityCheck(5, 100);
        } else if (quality == 2) {
            check = repo.probabilityCheck(1, 95);
        } else if (quality == 1) {
            check = repo.probabilityCheck(5, 940);
        } else {
            check = repo.probabilityCheck(1, 935);
        }
        return (getSeedTag(pack), check);
    }

    //调整果实属性
    //参数：PlantPropertiesPacked、Quality
    //返回：PlantPropertiesPacked
    function generateRandomAttribute(
        PlantPropertiesPacked memory _pack,
        uint256 quality
    ) public view returns (PlantPropertiesPacked memory) {
        if (repo.probabilityCheck(2, 10)) {
            _pack = followRandom(_pack);
        }
        PropertiesLegelCheck(_pack);
        if (quality == 3) {
            return followSpecie(_pack);
        } else if (quality == 2) {
            if (repo.probabilityCheck(50, 100)) {
                return followSpecie(_pack);
            }
            return _pack;
        } else if (quality == 1) {
            if (repo.probabilityCheck(30, 100)) {
                return followSpecie(_pack);
            }
            return _pack;
        } else {
            if (repo.probabilityCheck(10, 100)) {
                return followSpecie(_pack);
            }
            return _pack;
        }
    }

    //根据植物偏向调整属性
    //参数：PlantPropertiesPacked
    //返回：PlantPropertiesPacked
    function followSpecie(PlantPropertiesPacked memory _pack)
        internal
        view
        returns (PlantPropertiesPacked memory)
    {
        uint256 rnd = repo.getRandom(4);
        if (rnd == 0) {
            _pack.hp = uint8(
                int8(_pack.hp) + int8(specieData[uint256(_pack.specie)][0])
            );
        } else if (rnd == 1) {
            _pack.atk = uint8(
                int8(_pack.atk) + int8(specieData[uint256(_pack.specie)][1])
            );
        } else if (rnd == 2) {
            _pack.def = uint8(
                int8(_pack.def) + int8(specieData[uint256(_pack.specie)][2])
            );
        } else {
            _pack.spd = uint8(
                int8(_pack.spd) + int8(specieData[uint256(_pack.specie)][3])
            );
        }
        PropertiesLegelCheck(_pack);
        return _pack;
    }

    //全局随机调整属性
    //参数：PlantPropertiesPacked
    //返回：PlantPropertiesPacked
    function followRandom(PlantPropertiesPacked memory _pack)
        internal
        view
        returns (PlantPropertiesPacked memory)
    {
        _pack.hp = uint8(int8(_pack.hp) + getFollowRandom());
        _pack.atk = uint8(int8(_pack.atk) + getFollowRandom());
        _pack.def = uint8(int8(_pack.def) + getFollowRandom());
        _pack.spd = uint8(int8(_pack.spd) + getFollowRandom());
        PropertiesLegelCheck(_pack);
        return _pack;
    }

    //获取随机调整值
    //返回：int8
    function getFollowRandom() internal view returns (int8) {
        if (repo.probabilityCheck(5, 100)) {
            return 1;
        } else if (repo.probabilityCheck(5, 95)) {
            return -1;
        }
        return 0;
    }

    //属性合法性检查
    //参数：PlantPropertiesPacked
    //返回：PlantPropertiesPacked
    function PropertiesLegelCheck(PlantPropertiesPacked memory _pack)
        internal
        view
        returns (PlantPropertiesPacked memory pack)
    {
        //处理uint超界导致的极大数
        if (_pack.hp > 6) {
            _pack.hp = 0;
        }
        if (_pack.atk > 6) {
            _pack.atk = 0;
        }
        if (_pack.def > 6) {
            _pack.def = 0;
        }
        if (_pack.spd > 6) {
            _pack.spd = 0;
        }
        //处理单属性超界
        if (_pack.hp == 6) {
            _pack.hp--;
        }
        if (_pack.atk == 6) {
            _pack.atk--;
        }
        if (_pack.def == 6) {
            _pack.def--;
        }
        if (_pack.spd == 6) {
            _pack.spd--;
        }
        //处理总属性和>8
        uint256 rnd;
        while (_pack.hp + _pack.atk + _pack.def + _pack.spd > 8) {
            rnd = repo.getRandom(4);
            if (rnd == 0) {
                if (_pack.hp > 0) {
                    _pack.hp--;
                }
            } else if (rnd == 1) {
                if (_pack.atk > 0) {
                    _pack.atk--;
                }
            } else if (rnd == 2) {
                if (_pack.def > 0) {
                    _pack.def--;
                }
            } else {
                if (_pack.spd > 0) {
                    _pack.spd--;
                }
            }
            return _pack;
        }
    }

