    //杂交检查
    //参数：address _owner, uint8 _x,uint8 _y
    //返回：uint8 count,uint256
    function HybridizationCheck(
        address _owner,
        uint8 _x,
        uint8 _y
    ) public view override returns (uint8, uint256) {
        uint256 specie = fields[_owner][_x][_y].seedTag >> 17;
        uint256 sign;
        uint8 count;
        //up
        if (
            _y < 5 &&
            fields[_owner][_x][_y + 1].seedTag >> 17 == specie &&
            block.timestamp >= fields[_owner][_x][_y + 1].maturityTime
        ) {
            sign = (sign << 1) + 1;
            count++;
        }
        //down
        if (
            _y > 0 &&
            fields[_owner][_x][_y - 1].seedTag >> 17 == specie &&
            block.timestamp >= fields[_owner][_x][_y - 1].maturityTime
        ) {
            sign = (sign << 1) + 1;
            count++;
        }
        //left
        if (
            _x > 0 &&
            fields[_owner][_x - 1][_y].seedTag >> 17 == specie &&
            block.timestamp >= fields[_owner][_x - 1][_y].maturityTime
        ) {
            sign = (sign << 1) + 1;
            count++;
        }
        //right
        if (
            _x < 5 &&
            fields[_owner][_x + 1][_y].seedTag >> 17 == specie &&
            block.timestamp >= fields[_owner][_x + 1][_y].maturityTime
        ) {
            sign = (sign << 1) + 1;
            count++;
        }
        return (count, sign);
    }

    //随机杂交
    //参数：address _owner, uint8 _x,uint8 _y
    //返回：uint8
    function randomHybridize(
        address _owner,
        uint8 _x,
        uint8 _y
    ) public view override returns (uint8) {
        uint8 count;
        uint256 sign;
        uint8 p;
        (count, sign) = HybridizationCheck(_owner, _x, _y);
        if (count == 0) {
            return 0;
        }
        uint256 rnd = repo.getRandom(count);
        uint8[] memory temp;
        if (sign % 2 == 1) {
            temp[p] = 4;
            p++;
        }
        sign /= 2;
        if (sign % 2 == 1) {
            temp[p] = 3;
            p++;
        }
        sign /= 2;
        if (sign % 2 == 1) {
            temp[p] = 2;
            p++;
        }
        sign /= 2;
        if (sign % 2 == 1) {
            temp[p] = 1;
            p++;
        }
        return temp[rnd];
    }
